import { useContext } from "react";
import ThemeContext from "./ThemeContext";
import "./Ecommerce.css";
import { Link } from "react-router-dom";
function Cart() {
  const theme = useContext(ThemeContext);

  return (
    <div className={theme}>
      Hi this is the cart page.
      <div style={{ backgroundColor: "blue" }}>This is a new line. </div>
      <Link to="/">
        <button> Click me to go back to home page.</button>
      </Link>
    </div>
  );
}

export default Cart;
